import { useEffect } from "react";
import Post from "../components/Post";

export default function IndexPage(){
  useEffect(()=>{
    fetch('http://localhost:4000/profile',{
      credentials:'include'
    })
    .then(res=>{
      if(res.ok){
        return res.json();
      }
      else{
        throw new Error('not authorized');
      }
    })
    .then(data=>{
      console.log(data);
    })
    .catch(err=>{
      console.log(err);
    })
  },[])
  
  return(
    <div>
      <Post/>
      <Post/>
      <Post/>
    </div>
  )
}
